  return (

    <>


    <header class = "header">
          <PreLoader />

      <a href="#" class="logo">Jones.</a>

      <nav class = "navbar">
          <a href="#" class="active">Home </a>
          <a href="#">About </a>
          <a href="#">Services </a>
          <a href="#">Portfolios </a>
          <a href="#">Contact</a>


      </nav>
    </header>
      <div>

        <h1>Welcome to my app</h1>
      </div>

    </> 
     );
}

export default App;
